import React, { Component } from 'react';
import Container from 'react-bootstrap/Container';
import Title from './components/Title';
import Dashboard from './components/Dashboard';

class App extends Component {
    state = {//관객수, 누적관객수, 스크린수
        audit: [
            { id: 1, movieNm: "영화1", audit: 23000 },
            { id: 2, movieNm: "영화2", audit: 13000 },
            { id: 3, movieNm: "영화3", audit: 9000 },
            { id: 4, movieNm: "영화4", audit: 7800 },
            { id: 5, movieNm: "영화5", audit: 300 },
        ],

        audit: [
            { id: 1, movieNm: "영화6", audit: 223000 },
            { id: 2, movieNm: "영화7", audit: 313000 },
            { id: 3, movieNm: "영화8", audit: 89000 },
            { id: 4, movieNm: "영화9", audit: 72800 },
            { id: 5, movieNm: "영화10", audit: 30000 },
        ],

        audit: [
            { id: 1, movieNm: "영화11", audit: 320 },
            { id: 2, movieNm: "영화12", audit: 222 },
            { id: 3, movieNm: "영화13", audit: 220 },
            { id: 4, movieNm: "영화14", audit: 100 },
            { id: 5, movieNm: "영화15", audit: 30 },
        ],
    }

    render() {
        return (
            <Container>
                <Title />
                <Dashboard 
                  data={this.state}
                />
            </Container>
        )
    }
}

export default App;
